Producer: Ram Prasad Rijal
Director: Laxman Rijal
Actor/Actress: Aryan Sigdel and Nisha Adhikari
&quot;Dhunwaa Yo Nasha&quot; is a story of the vocalist of a music band, Avisekh, also known as Avi (played by Aryan Sigdel). He had formed the music band with two of his friends and a brother. Avi has a crush towards his classmate Sameera (Nisha Adhikari) and used a drug to gather the courage to propose her. Avi gets addicted to the drug and at one point he had to choose between drug and Sameera. Both, the drug and Sameera were important to him and he didn't want to loose any of them. On his friend's suggestion he helped Sameera get addicted to the drug.
Will Sameera find out that she was given drug unknowingly by Avi? How will they get out of it or will their life ruined by the drug? Find out ...
